

CREATE TABLE `admin` (
  `pwd` varchar(50) NOT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;






CREATE TABLE `article` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `article` varchar(255) NOT NULL,
  `description` varchar(255) NOT NULL,
  `prix` varchar(255) NOT NULL,
  `jour` varchar(255) NOT NULL,
  `auteur` varchar(255) NOT NULL,
  `type` varchar(50) NOT NULL,
  `views` int(11) NOT NULL,
  `pub` int(11) NOT NULL,
  `look` int(11) NOT NULL,
  `magasin` varchar(200) NOT NULL,
  `images` varchar(255) NOT NULL,
  `price` varchar(50) NOT NULL,
  `comment` int(11) NOT NULL,
  `heart` int(11) NOT NULL,
  `quantite` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=25 DEFAULT CHARSET=latin1;






CREATE TABLE `categories` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(250) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `chat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nom_orig` varchar(30) NOT NULL,
  `nom_dest` varchar(30) NOT NULL,
  `id_orig` int(11) NOT NULL,
  `id_dest` int(11) NOT NULL,
  `message` longtext NOT NULL,
  `heur` varchar(30) NOT NULL,
  `commun` varchar(255) NOT NULL,
  `valider` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=250 DEFAULT CHARSET=latin1;

