CREATE TABLE `chat_online` (
  `online_id` int(11) NOT NULL AUTO_INCREMENT,
  `online_ip` varchar(100) CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL,
  `online_user` varchar(255) NOT NULL,
  `online_status` enum('0','1','2') CHARACTER SET latin1 COLLATE latin1_german1_ci NOT NULL,
  `online_time` bigint(21) NOT NULL,
  PRIMARY KEY (`online_id`)
) ENGINE=MyISAM AUTO_INCREMENT=133 DEFAULT CHARSET=latin1;






CREATE TABLE `commande` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `creator` varchar(200) NOT NULL,
  `custum` varchar(200) NOT NULL,
  `article` varchar(200) NOT NULL,
  `day` varchar(50) NOT NULL,
  `adress` varchar(200) NOT NULL,
  `state` int(11) NOT NULL,
  `token` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;






CREATE TABLE `comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_article` int(11) NOT NULL,
  `name_user` varchar(30) NOT NULL,
  `comment` varchar(200) NOT NULL,
  `day` varchar(30) NOT NULL,
  `id_user` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;






CREATE TABLE `conversation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id0` int(11) NOT NULL,
  `id1` int(11) NOT NULL,
  `nom0` varchar(50) NOT NULL,
  `nom1` varchar(50) NOT NULL,
  `contenu` longtext NOT NULL,
  `msgUnRead` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `datausers` (
  `id_user` int(11) NOT NULL,
  `recherche` text NOT NULL,
  `heart` text NOT NULL,
  `town` varchar(50) NOT NULL,
  `sub` text NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='Save movements of users in the site';






CREATE TABLE `evenement` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `creation` varchar(50) NOT NULL,
  `evDay` varchar(50) NOT NULL,
  `title` varchar(100) NOT NULL,
  `prix` varchar(100) NOT NULL,
  `town` varchar(50) NOT NULL,
  `adress` varchar(250) NOT NULL,
  `description` varchar(500) NOT NULL,
  `images` varchar(500) NOT NULL,
  `auteur` varchar(200) NOT NULL,
  `magasin` varchar(200) NOT NULL,
  `nbInvit` varchar(100) NOT NULL,
  `state` int(11) NOT NULL,
  `verification` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `journalmoney` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `send` varchar(100) NOT NULL,
  `receive` varchar(100) NOT NULL,
  `amount` varchar(250) NOT NULL,
  `day` int(11) NOT NULL,
  `state` int(11) NOT NULL,
  `type` varchar(20) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `livraison` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Ville` varchar(50) NOT NULL,
  `Commune` text NOT NULL,
  `Quartier` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `magasin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nom` varchar(50) NOT NULL,
  `type` varchar(50) NOT NULL,
  `ville` varchar(50) NOT NULL,
  `adresse` varchar(100) NOT NULL,
  `description` varchar(250) NOT NULL,
  `id2` int(11) NOT NULL,
  `creation` varchar(20) NOT NULL,
  `profil` varchar(250) NOT NULL,
  `heart` int(11) NOT NULL,
  `nbArticle` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;






CREATE TABLE `notification` (
  `inde` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(200) NOT NULL,
  `type` varchar(50) NOT NULL,
  `user` varchar(200) NOT NULL,
  `day` varchar(50) NOT NULL,
  `creator` varchar(50) NOT NULL,
  `state` int(11) NOT NULL,
  `id` varchar(50) NOT NULL,
  PRIMARY KEY (`inde`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `placesevenement` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `titleInvit` varchar(250) NOT NULL,
  `idEvent` int(11) NOT NULL,
  `evDay` int(11) NOT NULL,
  `idUser` varchar(100) NOT NULL,
  `placeCode` varchar(100) NOT NULL,
  `placeNumber` int(11) NOT NULL,
  `adress` varchar(100) NOT NULL,
  `state` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `user` (
  `nom` varchar(255) NOT NULL,
  `postnom` varchar(255) NOT NULL,
  `ville` varchar(255) NOT NULL,
  `telephone` varchar(255) NOT NULL,
  `pass` varchar(255) NOT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `profil` varchar(30) NOT NULL,
  `mail` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=124 DEFAULT CHARSET=latin1;






CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `names` varchar(50) NOT NULL,
  `telephones` varchar(25) NOT NULL,
  `mail` varchar(50) NOT NULL,
  `profil` text NOT NULL,
  `abonnement` varchar(250) NOT NULL,
  `jour` varchar(50) NOT NULL,
  `town` varchar(50) NOT NULL,
  `password` varchar(50) CHARACTER SET dec8 COLLATE dec8_bin NOT NULL,
  `walletFc` varchar(100) NOT NULL,
  `walletdol` varchar(100) NOT NULL,
  `token` varchar(100) NOT NULL,
  `actif` varchar(100) DEFAULT NULL,
  `lastPosition` varchar(100) NOT NULL,
  `livraison` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=115 DEFAULT CHARSET=utf8mb4;






CREATE TABLE `visiteur` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `jour` varchar(50) NOT NULL,
  `ip` varchar(50) NOT NULL,
  `navigateur` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4721 DEFAULT CHARSET=latin1;




